document.getElementById("loginForm").addEventListener("submit",async function(e){
e.preventDefault();
var pw=document.getElementById("pw").value;
if(!pw)return;
document.getElementById("error").style.display="none";
document.getElementById("loading").style.display="block";
try{
var enc=new TextEncoder();
var raw=Uint8Array.from(atob(ED),function(c){return c.charCodeAt(0)});
var s=raw.slice(0,16);
var n=raw.slice(16,28);
var ct=raw.slice(28);
var km=await crypto.subtle.importKey("raw",enc.encode(pw),"PBKDF2",false,["deriveBits","deriveKey"]);
var key=await crypto.subtle.deriveKey({name:"PBKDF2",salt:s,iterations:100000,hash:"SHA-256"},km,{name:"AES-GCM",length:256},false,["decrypt"]);
var dec=await crypto.subtle.decrypt({name:"AES-GCM",iv:n},key,ct);
var html=new TextDecoder().decode(dec);
if(html.indexOf("<"+"!DOCTYPE")!==-1){
var parser=new DOMParser();
var newDoc=parser.parseFromString(html,"text/html");
document.head.innerHTML=newDoc.head.innerHTML;
document.body.innerHTML=newDoc.body.innerHTML;
document.body.style="";
var oldScripts=newDoc.querySelectorAll("script");
oldScripts.forEach(function(os){
var ns=document.createElement("script");
ns.textContent=os.textContent;
document.body.appendChild(ns);
});
}else{throw new Error("bad")}
}catch(err){
console.error(err);
document.getElementById("loading").style.display="none";
document.getElementById("error").style.display="block";
document.getElementById("pw").value="";
}});
</script>
